✨I’m extremely proud to share the  accomplishments we have made since we broke ground 2 years ago on the @blackwalkoffame. We have a Black Walk of Fame Highway, we have a permanent sign that marks the Walk of Fame in front of Mercedes Benz Stadium and most important is we have 42 emblems in the ground created by the great @dlwarfield. February 28th we will induct 3 iconic leaders,
@bjones1938 @ambassadorandrewyoung @danny_glover_officail. Please goto Theblackwalkoffame.Com to learn more about our upcoming induction or how you can support The Walk of Fame✨

